      | 48420 -> { ItemTypeData.id= 48420; name= "Decayed Medium Energy Nosferatu Mutaplasmid"; published= true; description= "This bioadaptive mutaplasmid tool is designed to interface with and alter energy charge leeching devices. As such this mutaplasmid could be used to mutate the performance characteristics of most energy nosferatu modules in the correct size class.    Triglavian bioadaptive technology makes extensive use of engineered colonies of extremophilic bacteria, that are used to grow, harvest and adapt various resources found in Abyssal Deadspace. Artificial colonizing plasmids integrated into specialist tools used for direct adaptation of technology can be found in Triglavian caches in various stages of development. These mutaplasmids can be used to alter the characteristics of a wide variety of equipment types, depending on the strain and the bioadaptive tool with which they are integrated.    The mutaplasmid colony integrated into this bioadaptive tool has begun to decay and mutation effects will be less pronounced as a result. While possible mutational benefits are low, the risks of using this mutaplasmid are also reduced."; marketGroupId= Some(2454); groupId= 1964; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
      | 48517 -> { ItemTypeData.id= 48517; name= "Panther Dawn of Liberation SKIN"; published= true; description= "The Great Rebellion was the dawn of liberation for the Minmatar tribes that once lived almost entirely under the dominion of the Amarr. When the slave revolt broke out in 20 BYC (AD 23216), it stunned an Amarr Empire already reeling from the shock of their defeat by the Jovian fleet at the Battle of Vak'Atioth.    The Minmatar that rose up were quickly able to cut a swathe through the territories surrounding the Matari home worlds, aided by groups of free Minmatar who had long operated as guerilla fighters both planet-side and in space. The Minmatar Republic was founded by four of the great tribes and was invited to join in the foundation of CONCORD in 3 BYC. By the end of YC 111, the Nefantar, Starkmanir and Thukker Tribes had rejoined their Brutor, Krusual, Sebiestor and Vherokior brothers and sisters in the Minmatar's Tribal Republic."; marketGroupId= Some(2113); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
