      | 49099 -> { ItemTypeData.id= 49099; name= "Zero-Point Mass Entangler"; published= true; description= "Scientists experimenting with abyssal filaments and their property of entangling with a ship's warp core to achieve a mass-energy exchange capable of moving vessels through space-time conduits were soon able to replicate different aspects of the overall effect. It was noticed that a reduction in the local effective mass of a ship could be achieved by dumping warp energy directly into the zero-point energy vacuum field. This  warp energy-mass entanglement  effect was determined to severely reduce practical ship velocities and disable warping.    Scientists considered this effect important but unlikely to be of much use to anyone for practical purposes. However, engineers familiar with capsuleer exploration and colonization of Anoikis, or W-space, soon pointed out a market opportunity and a modular version of the curious device came into being."; marketGroupId= Some(2509); groupId= 2008; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 4; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 6; value= 100.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 40.000000 }; { DogmaAttributeValueData.attributeId = 1164; value= -90.000000 }; { DogmaAttributeValueData.attributeId = 1298; value= 894.000000 }; { DogmaAttributeValueData.attributeId = 278; value= 4.000000 }; { DogmaAttributeValueData.attributeId = 1180; value= 0.010000 }; { DogmaAttributeValueData.attributeId = 30; value= 80.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 50.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 422; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 2603; value= -95.000000 }; { DogmaAttributeValueData.attributeId = 50; value= 80.000000 }; { DogmaAttributeValueData.attributeId = 1074; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 183; value= 11446.000000 };