      | 49681 -> { ItemTypeData.id= 49681; name= "Men's 'Eico Flamjaw' Facial Augmentation"; published= true; description= "Environmental information capture overlays go several steps beyond somatosensory meshes and considerably enhance the sensory capabilities of those  wearing  such extensive facial augmentations. While this level of cybernetics can hardly be masked by mere nanocoatings there is still considerable scope for working in decorative elements.    Eico augmentations include systems that improve the connection between an augmented individual's consciousness and their nervous-emotional responses. However, these more extensive and elaborate information capture and processing systems hugely increase the types and range of environmental information that can be absorbed by an individual.    Whether sipping cocktails in the zero-g bars of Caille, or ripping apart the sputtering remains of a pirate vessel with your guns in nullsec, one thing will be certain: those who see your face will have it etched into their memory forever."; marketGroupId= Some(1836); groupId= 1670; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.500000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
