      | 50069 -> { ItemTypeData.id= 50069; name= "Confessor Eros Blossom SKIN"; published= true; description= "Traditional imagery of the petals of a blossom long associated with love and desire adorn the flanks of any ship using this romantically charged nanocoating from the Guardian Angels. Whether those choosing to display this tribute to the Eros Blossom are celebrating a love held close or are seeking another to receive their devotion is left to the observer to decide."; marketGroupId= Some(2310); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 52203 -> { ItemTypeData.id= 52203; name= "Journey of Katia Sae Memorial"; published= false; description= "<i>In the unending dark of space, there are a few bright lights to which we can reliably turn for guidance and inspiration. <url=showinfo:1373//885864009>Katia Sae</url> is one such beacon, a shining example of what we can all aspire towards. She exemplifies the attitude of a true explorer: friendly to all in her travels, neutral and never initiating aggression, and very, very hard to catch.    She began her quest to explore all of New Eden starting from Saisio III on December 1 of YC111 and came full circle back to Saisio on March 9 of YC121 after having explored every known-space and wormhole system that can be reached – all without a single ship loss.    May <url=showinfo:1373//885864009>Katia Sae</url>’s epic journey be remembered forevermore by all who travel into the furthest reaches of New Eden and the fathomless depths of Anoikis. Every star is one of her footprints, and every heavenly body tells the tale:  Katia Sae was here. </i>    The Journey of <url=showinfo:1373//885864009>Katia Sae</url> Memorial,   raised by the Achura Stargazers Society,  in association with <url=showinfo:2//98372649>Signal Cartel</url>"; marketGroupId= None; groupId= 226; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= Some(24406); mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 8500.000000; volume= 0.000000 } |> Some
