      | 52397 -> { ItemTypeData.id= 52397; name= "Brutix Triglavian Twilight SKIN"; published= true; description= "Commissioned in YC121 by CONCORD's own Kjersidur Elladall of the Directive Enforcement Department, these commemorative SKINs serve as a reminder and a badge of honour for those daring Capsuleers who risked all to say  I was there  when the Triglavian Collective breached the boundaries of Abyssal Deadspace and invaded the systems of New Eden.    In that year across the Empire-owned systems of the cluster, Conduits from Abyssal Deadspace appeared and carried the forces of the Collective into the comparatively rich and utopian star systems that CONCORD and the DED are sworn to protect.    CONCORD will never forget - nor fail to honour - the brave pilots who dedicated their time, their resources and their clones in the fight against the Triglavian menace."; marketGroupId= Some(1958); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
